import React from "react";
import { AppBar, Avatar, Badge, Box, IconButton, Toolbar, Typography } from "@mui/material";
import { Mail, Notifications, Search } from "@mui/icons-material";
import { Searchbox } from "./style/searchbar/Searchbox";
import { StyledInputBase } from "./style/searchbar/StyledInputBase";
import { SearchIconWrapper } from "./style/searchbar/SearchIconWrapper";
import { Iconbox } from "./style/iconbar/Iconbox";
import { deepPurple } from "@mui/material/colors";

const NavBar = () => {
    return (
        <AppBar>
            <Toolbar>
                <Typography variant="h6">
                    CSE Society
                </Typography>
                <Searchbox>
                    <SearchIconWrapper> 
                        <Search /> 
                    </SearchIconWrapper>

                    <StyledInputBase 
                    placeholder="Searchâ€¦" 
                    inputProps={
                        { 
                            'aria-label': 'search' 
                        }
                    } 
                />    
                </Searchbox>
                <Box sx={{ flexGrow: 1 }} />
                <Iconbox>
                    <IconButton size="large" aria-label="mails-button" color="inherit">
                        <Badge color="error" variant="dot" overlap="circular">
                            <Mail />
                        </Badge>
                    </IconButton> 
                    <IconButton size="large" aria-label="notifications-button" color="inherit">
                        <Badge color="error" variant="dot" overlap="circular">
                            <Notifications />
                        </Badge>
                    </IconButton>
                    <Avatar sx={{ bgcolor: deepOran[500] }}>N</Avatar>
                </Iconbox>
            </Toolbar>
        </AppBar>
    );
};

export default NavBar;
